import React from "react";
import { createNewNotebook } from "./../utilities.js"

function NewItemPopup() {
  return (
    <div className="new-item-popup">
      <div
        className="popup-row"
        onClick={createNewNotebook}
      >
        <p>Notebook</p>
      </div>
      <div
        className="popup-row"
      >
        <p>Dataset</p>
      </div>
      <div
        className="popup-row"
      >
        <p>Chart</p>
      </div>
    </div>
  );
}

export default NewItemPopup;
